import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../note";


function createNotes(noteItem){
    return <Note title={noteItem.title} content={noteItem.content}/>
}

function App(){
    return (
        <>
            <Header/>
            <Note/>
            <Footer/>
        </>
    )

}

export default App;
